import React, { Component } from 'react';

class Photo extends Component {
  render() {
    return(
      <li className="thumbnail">
        <img src="https://farm5.staticflickr.com/4334/37032996241_4c16a9b530.jpg" alt="" />
      </li>
    )
  }
}

export default Photo;
